    public static boolean isRepeating(StringBuilder str) {
        HashSet charSet = new HashSet<>();
        for (int i = 0; i < str.length(); i++) {
            if (charSet.contains(str.charAt(i))) {
                return true;
            }
            charSet.add(str.charAt(i));
        }
        return false;
    }
